    false,nt"url": null,nt"notes": "The TIGER/Line shapefiles and related database
    files (.dbf) are an extract of selected geographic and cartographic information
    from the U.S. Census Bureau's Master Address File / Topologically Integrated Geographic
    Encoding and Referencing (MAF/TIGER) Database (MTDB).  The MTDB represents a seamless
    national file with no overlaps or gaps between parts, however, each TIGER/Line shapefile
    is designed to stand alone as an independent data set, or they can be combined to
    cover the entire nation.nnnIn New England (Connecticut, Maine, Massachusetts, New
    Hampshire, Rhode Island, and Vermont), the Office of Management and Budget (OMB)
    has defined an alternative county subdivision (generally cities and towns) based
    definition of Core Based Statistical Areas (CBSAs) known as New England City and
    Town Areas (NECTAs).  NECTAs are defined using the same criteria as Metropolitan
    Statistical Areas and Micropolitan Statistical Areas and are identified as either
    metropolitan or micropolitan, based, respectively, on the presence of either an
    urban area of 50,000 or more population or an urban cluster of at least 10,000 and
    less than 50,000 population.  A NECTA containing a single core urban area with a
    population of at least 2.5 million may be subdivided to form smaller groupings of
    cities and towns referred to as NECTA Divisions.  nnnThe NECTAs for the 2010 Census
    are those defined by OMB and published in 2013. n",nt"license_title": null,nt"extras":
